script: |
  super -f text -I q7924.spq | sort > q7924.out

inputs:
  - name: q7924.spq
    data: |
      SELECT DISTINCT + col2 * 60 FROM tab1 (FORMAT parquet) WHERE NOT + col2 > - CAST ( 58 AS INTEGER ) AND NOT CAST ( + col0 AS REAL ) BETWEEN + col2 AND + col1;
  - name: tab1

outputs:
  - name: q7924.out
    data: |
